import { title } from "assets/jss/material-kit-react.jsx";

const activityStyle = {
  section: {
    padding: "70px 0"
  },
  title: {
    ...title,
    marginBottom: "50px",
    marginTop: "30px",
    minHeight: "32px",
    textDecoration: "none",
    textAlign: "center"
  },
  btnDiv: {
    left: "0",
    display: "block !important",
    position: "absolute"
  }
};

export default activityStyle;
